import React from 'react';
import { BrowserRouter, Routes } from 'react-router-dom';
import Signin from './Signin'; // Importez votre composant de connexion ici
import Toasts from './Toasts'; // Importez votre composant de toasts ici
import NotFound from './NotFound'; // Importez votre composant NotFound ici
import RouteWithSidebar from './RouteWithSidebar'; // Importez votre composant RouteWithSidebar ici
import { Routes as AppRoutes } from '../routes'; // Importez vos chemins de route depuis votre fichier routes

const RouteSi = () => {
  return (
    <BrowserRouter>
      <Routes>
      <RouteWithLoader exact path={Routes.Signin.path} component={Signin} />
        
      <Redirect to={Routes.NotFound.path} />
      </Routes>
    </BrowserRouter>
  );
};

export default RouteSi;
